import React from 'react';
import './portfolios.css';

class Portfolios extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
		  <div>
			  	  <div className="container">
					<div className="dealslist">
						COMING SOON
					</div>
				  </div>
	 	  </div>
		);
	}
}

export default Portfolios;
